import React from 'react'
import ReactDOM from 'react-dom'

const Song = (props) => {
  return (
    <div>
      <h1>
        Song {props.num}
      </h1>
      <iframe title = "pog" src={props.link} width="300" height="80" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
    </div>
  )
}

const App = () => {
  console.log('Hello from component')
  return (
    <div>
      <p>Hello world</p>
      <Song link="https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r" num = "1"/>
      <Song link="https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r" num = "2"/>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
